  // children \u8282\u70B9 schema
  properties?: Record<string, ISchema>;

  // \u4EE5\u4E0B\u4EC5\u5B57\u6BB5\u7EC4\u4EF6\u65F6\u4F7F\u7528

  // \u5B57\u6BB5\u8054\u52A8
  ['x-reactions']?: SchemaReactions;
  // \u5B57\u6BB5 UI \u4EA4\u4E92\u6A21\u5F0F\uFF0C\u9ED8\u8BA4\u4E3A 'editable'
  ['x-pattern']?: 'editable' | 'disabled' | 'readPretty';
  // \u5B57\u6BB5\u6821\u9A8C
  ['x-validator']?: Validator;
  // \u9ED8\u8BA4\u6570\u636E
